
function hasAlone(str) {
	var obj ={};
	for (var i = 0; i < str.length; i ++) {
		var cur = str[i];
		if (obj[cur] !== undefined) {
			return false;
		} else {
			obj[cur] = cur;
		}
	}
	return true;
}

function hasAloneSet(str) {
	if (str.length === new Set(str).size) {
		return true;
	} else {
		return false;
	}
}

