var lengthOfLongestSubstrings = function (s) {
	var length = s.length;
	if (typeof s !== 'string') return -1;
	if (length <= 1) return length;

	var maxLen = 1;
	
	for (var i = 0; i < length; i ++) {
		for (var j = i + 1; j <= length ; j ++) {
			var cur = s.substring(i, j);
			if (hasAloneSet(cur)) {
				maxLen = cur.length > maxLen ? cur.length : maxLen;
			} else {
				break;
			}
		}

		
		if (maxLen > length - i) {
			break;
		}
	}
	return maxLen;
};

